  input: '"TEXT","F3XA","C00388793","This amendment is in reponse to requests for
    additional information sent on June 29, 2005.  One request asked for information
    relating to a contribution reported in January, 2005, to Friends of Doc Hastings
    for 2002 Debt Retirement.  After an investigation, it was discovered that the
    check was never given to the Hastings campaign, therefore, they never reported
    the check.  In July, I canceled the check and that cancellation/void will be reflected
    in my report to be filed on August 20th.  According to our investigation, the
    check was lost and never given to the Hastings campaign.  Also, in another request
    for information, we were asked to explain any administrative charges that were
    not listed.  Growth and Prosperity PACs only overhead are salary and related expenses.   During
    January, February, and March, two persons were being paid, Johanna Cole ($250)
    and Barbara Bonfiglio.   Ms. Bonfiglio (former treasurer) would bill Growth PAC
    every few months.  She was last paid in April and is no longer employed by Growth
    and Prosperity PAC.   Johanna Cole was paid for January in February, so those
    expenses are found in the March monthly report."'
